s": []}}}]}}}, {"node": {"__typename": "GraphImage", "id": "1531456908635364981", "dimensions": {"height": 1080, "width": 1080}, "display_url": "https://instagram.fcgk8-1.fna.fbcdn.net/t51.2885-15/e35/18879258_479792482357573_3613727621054988288_n.jpg", "is_video": false, "edge_media_to_tagged_user": {"edges": []}, "attribution": null, "shortcode": "BVA0_HEB151", "edge_media_to_caption": {"edges": [{"node": {"text": "Andai Nikmat Dunia Bisa Menyelamatkan\n\nSendainya harta yang banyak itu berarti kebaikan, maka Qarun tidak akan binasa karenanya. Jika tahta dan kuasa itu kebaikan, maka Fir'aun tak ditenggelamkan karenanya\n\nApabila gelar dan pengetahuan itu pasti menyelamatkan, maka Haman tak akan celaka. Manakala cinta saja cukup, maka istri Nabi Nuh pasti menaati perintah suaminya\n\nTapi kita melihat, bahwa harta tahta kata dan cinta yang selalu dianggap sebagai kebahagiaan bagi manusia saat ini, ternyata belum tentu mampu membawa bahagia\n\nJustru banyak manusia celaka sebab nikmat dunia yang diberi kepadanya, padahal mungkin dia adalah orang yang bertahan saat diberikan ujian kekurangan sebelumnya\n\nKarena itulah Rasulullah memberitahu, bukan kemiskinan yang beliau khawatirkan atas kita, tapi justru ketika dunia dibukakan kepada kita layaknya orang sebelum kita\n\nLalu kita berlomba-lomba mendapatkannya dengan berbagai cara, tanpa memedulikan lagi tentang halal-haram, baik buruk, lalu kita dibinasakan sebab harta dunia itu\n\nKita tak hendak mengatakan bahwa harta, tahta, kata dan cinta itu tidak penting. Yang hendak kita sampaikan, itu hanya alat saja, sementara alat ditentukan penggunanya\n\nDunia bisa dibuat jadi jalan menuju keridhaan Allah, juga bisa jadi jalan bagi kita untuk dimurkai Allah. Lalu apakah yang jadi pembeda diantara keduanya? ridha dan murka?\n\nRasulullah sampaikan kepada kita, satu hal penting, \"Siapa yang Allah kehendaki padanya kebaikan, maka Allah akan faqihkan dia dalam perkara agama\" HR Bukhari Muslim\n\nInilah yang harusnya kita berlomba di dalamnya, memahami agama, karena dengan Islam seseorang bisa menempatkan sesuatu secara benar dan seharusnya\n\nDi tangan Abdurrahman bin Auf, harta berbuah surga. Saat Umar bin Khaththab menggengam tahta, Allah beri ridha, sebab mereka memahami perkara agama ini\n\nMaka tak perlu hasad dan iri pada orang lain bila itu perkara dunia, ingat-ingat bahwa orang zaman dulu lebih hebat dari kita perlombaannya, namun mereka akhirnya celaka\n\nIri itu pada mereka yang diberi Al-Qur'an dan mampu beramal dengannya, juga mereka yang diberi harta lalu berderma siang dan malamnya. Inginlah seperti mereka"}}]}, "edge_media_to_comment": {"count": 99, "page_info": {"has_next_page": true, "end_cursor": "AQD36Rjqp0rmfRIQzWJ13WM_LPlQX4iVhMbcYymnfSTPQBfC2e1VVQ0HajokAMv4qoUrpKOSx9tccsU5biXHl6GgZ8bPZ-Dh4DgM_nOvs_i6Zg"}, "edges": [{"node": {"id": "17858348419182443", "text": "@dandydamn coba follow inin deh", "created_at": 1496796641, "owner": {"id": "1022709542", "profile_pic_url": "https://instagram.fcgk8-1.fna.fbcdn.net/t51.2885-19/s150x150/18444240_1519483351417372_6875586369893171200_a.jpg", "username": "ziahzone"}}}, {"node": {"id": "17843307220198562", "text": "Kata2 e apik  @mandayufarhana", "created_at": 1496796662, "owner": {"id": "1401920385", "profile_pic_url": "https://instagram.fcgk8-1.fna.fbcdn.net/t51.2885-19/s150x150/18011790_411893435851602_9002148218582073344_a.jpg", "username": "eka.swastika"}}}, {"node": {"id": "17882753866056334", "text": "Nanaaa\ud83d\ude22 @ratnaisyah", "created_at": 1496796796, "owner": {"id": "3653417845", "profile_pic_url": "https://instagram.fcgk8-1.fna.fbcdn.net/t51.2885-19/s150x150/15623914_1692303377726280_3633334279905214464_a.jpg", "username": "rinrinhandini1211"}}}, {"node": {"id": "17858359456182787", "text": "izin share ustadz.", "created_at": 1496796969, "owner": {"id": "5409269038", "profile_pic_url": "https://instagram.fcgk8-1.fna.fbcdn.net/t51.2885-19/s150x150/18161708_1129395293837099_6734751862521593856_a.jpg", "usernam